export interface MouseMazeProps {
    flag: string;          // La bandera que el ratn debe encontrar en el laberinto.
    matrix: string[][];    // La matriz que representa el laberinto.
}

/**
 * Interfaz que representa una celda en el laberinto.
 */
interface Cell {
    /**
     * Verifica si es posible caminar sobre esta celda.
     * @returns \`true\` si se puede caminar sobre la celda, \`false\` de lo contrario.
     */
    canWalk(): boolean;

    /**
     * Verifica si esta celda es la salida del laberinto.
     * @returns \`true\` si es la salida, \`false\` de lo contrario.
     */
    isExit(): boolean;
}

/**
 * Interfaz que representa la posicin actual del ratn en el laberinto.
 */
interface CellPosition {
    /**
     * Obtiene la celda en una posicin especfica en relacin con la posicin actual.
     * @param position La direccin en la que buscar la celda ('up', 'down', 'left', 'right').
     * @returns La celda en la posicin especificada.
     */
    getCell(position: string): Cell;

    /**
     * Obtiene la posicin actual del ratn en el laberinto.
     * @returns La posicin actual en formato de cadena.
     */
    getCurrentPosition(): string;
}

